objetoCompra:
Contratação de serviços de capacitação técnica (treinamento), com emissão de Certificado de Conclusão de Curso, destinados a atender às necessidades do Instituto de Estudos do Mar Almirante Paulo Moreira (IEAPM), compreendendo a realização dos seguintes cursos:

Curso em Análise e Interpretação da norma ABNT NBR ISO/IEC 17025:2017, com carga horária mínima de 12 (doze) horas, para até 15 (quinze) participantes;

Curso em Gestão de Riscos conforme requisitos da norma ABNT NBR ISO/IEC 17025:2017, com carga horária mínima de 3 (três) horas, para 3 (três) participantes;

Curso em Interpretação de Certificados de Calibração, com carga horária mínima de 3 (três) horas, para 1 (um) participante;

Curso em Tratamento de Não-Conformidades conforme requisitos da norma ABNT NBR ISO/IEC 17025:2017, com carga horária mínima de 3 (três) horas, para 1 (um) participante.

Os cursos deverão ser ministrados por profissionais ou instituição com experiência comprovada na área de gestão da qualidade laboratorial e aplicação da norma ABNT NBR ISO/IEC 17025:2017, incluindo o fornecimento de material didático (digital ou impresso) e a emissão de certificados individuais de participação.

Contratação de colaboradora eventual, com notório saber, para ministrar duas palestras sobre o tema "Desafios Contemporâneos para o Mundo do Trabalho: Da Desconexão à Conexão Laboral", com o objetivo de promover a conscientização sobre os impactos da hiperconectividade e o cuidado com a saúde mental no contexto do trabalho.
Palestra 1) 22/09/2025 - Público-alvo: Ocupantes de cargos de chefia e magistrados;
Palestra 2) 29/09/2025- Público-alvo: Servidores, estagiários e terceirizados.
